import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header>
        <img src="https://www.iguides.ru/upload/iblock/e19/e19d6ea90a6b90e7ee7c53f0de2eb400.jpg" alt="Tut fotka"/>
      </header>
      <nav>
        <div>Profile</div>
        <div>Messages</div>
        <div>News</div>
        <div>Music</div>
        <div><b></b>Content</div>
      </nav>
    </div>
  );
}

export default App;
